jobs_results.description:
Команда Wachanga - международный стартап, мы создали экосистему мобильных приложений для семьи и родителей, сейчас это уже почти 2 миллиона активных пользователей по всему миру. Среди приложений Wachanga: женский календарь, календарь беременности, ассистент по грудному кормлению и уходу за младенцем и др.

Данная вакансия подходит для кандидата, который имеет опыт продуктовой Android-разработки, либо опыт реализации любых своих идей (pet-проекты)

Чем предстоит заниматься:
• Разрабатывать и поддерживать новый функционал продукта;
• Самостоятельно решать сложные задачи;
• Улучшать процессы и архитектуру вместе с командой.

Мы ждём от тебя:
• Опыт разработки android приложений от двух лет;
• Уверенное знание Java и Kotlin; Умение работать с Git;
• Умение применять современные практики разработки: внедрение зависимостей и архитектурные шаблоны;
• Знаком с RxJava, Dagger, Moxy, Room, Retrofit;
• Опыт работы с многомодульными проектами и Compose будет преимуществом.

От нас:
• Гибкий график;
• Удаленная работа;
• Официальное трудоустройство по ТК РФ;
• Заработная плата дважды в месяц и точно в срок.
